(249, '37', '248', 'Hola @rosa este tipo de situaciones', 'Hola <a href=''/usuario/122''>@rosa</a> este tipo de situaciones siempre son la duda constante. Se dice que la mejor seguridad es la que no se ve...y realmente es así en parte. Por un lado está la seguridad o sistemas disuasorios y por otro la seguridad activa. Cuando se habla de americanos, ellos son muy propensos a exagerar todas las medidas disuasorias sin descuidar la parte activa. También tenemos que entender, que sí ó sí, si desean desprender cercanía se ven obligados a estar cerca de la gente y eso supone riesgo. Ahí está la balanza y el problema al que se exponen muchos profesionales, cuando el protegido/vip desoye a su jefe de seguridad, y éstos tienen que asegurar la integridad del Vip en circunstancias de riesgo.', 'Hola <a href=''/usuario/122''>@rosa</a> este tipo de situaciones siempre son la duda constante. Se dice que la mejor seguridad es la que no se ve...y realmente es así en parte. Por un lado está la seguridad o sistemas disuasorios y por otro la seguridad activa. Cuando se habla de americanos, ellos son muy propensos a exagerar todas las medidas disuasorias sin descuidar la parte activa. También tenemos que entender, que sí ó sí, si desean desprender cercanía se ven obligados a estar cerca de la gen', '', '2016-06-30 15:25:54', '2016-06-30 15:25:54'),
