(264, '40', '0', 'La Agencia Española de Consumo, Seguridad', 'La Agencia Española de Consumo, Seguridad Alimentaria y Nutrición (Aecosan) ha confirmado la presencia de la toxina botulínica en una de las latas de judías blancas cocidas que consumieron el pasado día 27 dos bomberos de Palafrugell (Girona), hospitalizados por un brote de botulismo y que se mantienen ingresados en la UCI en estado grave.\r\n\r\nEn concreto, han detectado la toxina en el lote ''L-146-16'' del bote de 400 gramos de la marca ''Bonpreu'', envasado por Hermanos Cuevas y con consumo preferente antes del 31 de diciembre del 2021.\r\n\r\nDel mismo modo, las autoridades competentes de La Rioja han confirmado que hay productos sospechosos correspondientes al mismo lote de fabricación que el que ha resultado positivo, de las marcas ''IFA Eliges'' (lote 146-16 y L 168-16), ''Bonpreu'' (lotes 146-16 y L-176-16), ''Condis catalán'' (lotes 146-16, L-151-16 y L-158-16), ''Condis castellano'' (lotes 146-16 y L-176-16) y ''El Cultivador'' (L-151-16 y L-158-16). Aecosan aconseja a las personas que tengan en su casa algún envase de estos productos que se abstengan de consumirlos.', 'La Agencia Española de Consumo, Seguridad Alimentaria y Nutrición (Aecosan) ha confirmado la presencia de la toxina botulínica en una de las latas de judías blancas cocidas que consumieron el pasado día 27 dos bomberos de Palafrugell (Girona), hospitalizados por un brote de botulismo y que se mantienen ingresados en la UCI en estado grave.\r\n\r\nEn concreto, han detectado la toxina en el lote ''L-146-16'' del bote de 400 gramos de la marca ''Bonpreu'', envasado por Hermanos Cuevas y con consumo prefere', 'consejo-40-62.jpeg', '2016-07-04 12:48:04', '2016-07-04 12:48:04'),
