(442, '38', '429', 'Si te dedicas a escribir entradas', 'Si te dedicas a escribir entradas para un blog o posts en redes sociales, seguro que te has preguntado alguna vez ¿Cuál es la extensión perfecta para mis publicaciones? ¿Cuál es el número de caracteres perfecto para favorecer un buen posicionamiento SEO? La respuesta depende de la red social de la que estemos hablando. Está claro que no es lo mismo escribir para Twitter que para Instagram o Facebook. Veamos entonces cuales son las extensiones ideales para cada tipo de canal de contenido.\r\nBlog\r\n\r\nLas publicaciones de los blogs no deben contener menos de 300 palabras y los expertos aseguran que lo mejor es superar las mil palabras (si llega a las 1.500 mejor que mejor). El encabezado debe contener una media de entre 8 y 10 palabras y no debe superar los 80 caracteres. La palabra o palabras claves deben estar en el principio del título para que este aparezca en los puestos más altos a la hora de que los usuarios hagan búsquedas.\r\n\r\nSi quieres enfocar tus títulos para las redes sociales tienes dos opciones. Si son para Twitter, estos deben ser lo más cortos posibles. Si son para Facebook, puedes extenderte un poco más con los caracteres.\r\nFacebook\r\n\r\nFacebook pone el límite de sus pub', '', '', '2017-10-16 16:20:54', '2017-10-16 16:20:54'),
