(517, '178', '0', '', 'Pero en realidad esas primeras palabras son \\u00ABDesocupado lector\\u00BB: es la interpelaci\\u00F3n con que comienza el \\u00ABPr\\u00F3logo...\\u00BB, antes de los poemas preliminares. En 2004, un equipo multidisciplinario de acad\\u00E9micos de la\\u00A0Universidad Complutense de Madrid, desobedeciendo la propia indicaci\\u00F3n cervantina (expresa en varios lugares) de dejarse en el tintero el nombre del ficticio \\u00ABlugar\\u00BB de Alonso Quijano, hicieron una investigaci\\u00F3n para deducir el sitio exacto de La Mancha. Utilizaron no m\\u00E1s que las distancias a varios pueblos y lugares, descritas por Cervantes en su novela, que tomaron la forma de d\\u00EDas y noches viajadas en caballo por don Quijote. Suponiendo que el lugar est\\u00E1 en la comarca de\\u00A0Campo de Montiel, y que la velocidad de\\u00A0Rocinante/Rucio est\\u00E1 comprendida entre los 30 y 35\\u00A0km por jornada, llegaron a la conclusi\\u00F3n que la poblaci\\u00F3n de origen de don Quijote era\\u00A0Villanueva de los Infantes.[21]\\u200B[22]\\u200B Sin embargo, Villanueva de los Infantes era una\\u00A0villa, no un lugar (la denominaci\\u00F3n topogr\\u00E1fica que se encuentra entre\\u00A0aldea\\u00A0y villa), as\\u00ED que bien podr\\u00EDa ser\\u00A0Miguel Estebano cualquier otro lugar pr\\u00F3ximo a\\u00A0El Toboso\\u00A0o, m\\u00E1s exactamente, ninguno o todos ellos, porque se trata de un lugar ficticio', 'Pero en realidad esas primeras palabras son \\u00ABDesocupado lector\\u00BB: es la interpelaci\\u00F3n con que comienza el \\u00ABPr\\u00F3logo...\\u00BB, antes de los poemas preliminares. En 2004, un equipo multidisciplinario de acad\\u00E9micos de la\\u00A0Universidad Complutense de Madrid, desobedeciendo la propia indicaci\\u00F3n cervantina (expresa en varios lugares) de dejarse en el tintero el nombre', '', '2018-01-16 13:31:03', '2018-01-16 13:31:03'),
