(753, '1', '0', '', 'Jaipur (/\\u02c8d\\u0292a\\u026ap\\u028a\\u0259r/ (About this sound listen))[2][3][4] is the capital and the largest city of the Indian state of Rajasthan in Northern India. It was founded on 18 November 1727 by Jai Singh II,[5] the ruler of Amer after whom the city is named.[6] As of 2011, the city has a population of 3.1 million, making it the tenth most populous city in the country. Jaipur is also known as the Pink City of India.[7] It is located 280 km (174 miles) from the Indian capital New Delhi. Jaipur is a popular tourist destination in India and forms a part of the west Golden Triangle tourist circuit along with Delhi and Agra (240 km, 149 mi).[8] It also serves as a gateway to other tourist destinations in Rajasthan such as Jodhpur (348 km, 216 mi), Jaisalmer (571 km, 355 mi) Udaipur (421 km, 262 mi) and Mount Abu (520 km, 323 mi). <br/>  <br/> Jaipur is home to two UNESCO World Heritage Sites: the Jantar Mantar and the Amer Fort.', 'Jaipur (/\\u02c8d\\u0292a\\u026ap\\u028a\\u0259r/ (About this sound listen))[2][3][4] is the capital and the largest city of the Indian state of Rajasthan in Northern India. It was founded on 18 November 1727 by Jai Singh II,[5] the ruler of Amer after whom the city is named.[6] As of 2011, the city has a population of 3.1 million, making it the tenth most populous city in the country. Jaipur is also k', '', '2018-03-13 11:06:34', '2018-03-13 11:06:34'),
(754, '1', '0', '', 'The city of Jaipur was founded in 1727 by Jai Singh II, the Raja of Amer who ruled from 1699 to 1743. He planned to shift his capital from Amer, 11 kilometres (7 mi) from Jaipur to accommodate the growing population and increasing scarcity of water.[6] Jai Singh consulted several books on architecture and architects while planning the layout of Jaipur. Under the architectural guidance of Vidyadhar Bhattacharya, Jaipur was planned based on the principles of Vastu shastra and Shilpa Shastra.[9] The construction of the city began in 1726 and took four years to complete the major roads, offices and palaces. The city was divided into nine blocks, two of which contained the state buildings and palaces, with the remaining seven allotted to the public. Huge ramparts were built, pierced by seven fortified gates.[6] <br/>  <br/> Jaipur is a standout amongst the most socially rich legacy urban areas in India. Established in the year 1727, the city is named after Maharaja Jai Singh II who was the primary organizer of this city. He was a Kachhwaha Rajput and ruled the region in the vicinity of 1699 and 1744. <br/>  <br/> During the rule of Sawai Ram Singh I, the city was painted pink to welcome the Prince of Wales, later Edward VII, in 1876.[10] Many of the avenues remained painted in pink, giving Jaipur a distinctive appearance and the epithet Pink city.[11] In the 19th century, the city grew rapidly and by 1900 it had a population of 160,000. The wide boulevards were paved and its chief industries were the working of metals and marble, fostered by a school of art founded in 1868.[5] The city had three colleges, including a Sanskrit college (1865) and a girls'' school (1867) opened during the reign of the Maharaja Ram Singh II.[12][13]', 'The city of Jaipur was founded in 1727 by Jai Singh II, the Raja of Amer who ruled from 1699 to 1743. He planned to shift his capital from Amer, 11 kilometres (7 mi) from Jaipur to accommodate the growing population and increasing scarcity of water.[6] Jai Singh consulted several books on architecture and architects while planning the layout of Jaipur. Under the architectural guidance of Vidyadhar', '', '2018-03-13 11:07:51', '2018-03-13 11:07:51'),
